from pickle import FALSE
from django.db import models

class Equipo(models.Model):
    Nombre_Equipo = models.CharField(max_length=100, null=False, blank=False)
    Imagen= models.CharField(max_length=100, null=False, blank=False)
    Escudo= models.CharField(max_length=100, null=False, blank=False)

    def __str__(self):
        return self.Nombre_Equipo

class Jugadores(models.Model):
    idEquipo= models.PositiveIntegerField(verbose_name='id equipo', default=0)
    Foto= models.CharField(max_length=100, null=False, blank=False)
    Nombre= models.CharField(max_length=100, null=False, blank=False)
    Apellido= models.CharField(max_length=100, null=False, blank=False)
    Fnacimiento= models.CharField(max_length=100, default=FALSE)
    Edad = models.PositiveIntegerField(verbose_name='edad', default=0)
    Posición= models.CharField(max_length=20, null=False, blank=False)
    NCamiseta= models.CharField(max_length=5, null=False, blank=False)
    titular= models.CharField(max_length=50, null=False, blank=False)

    def __str__(self):
        return self.Nombre


class Cuerpo_técnico(models.Model):
    idEquipo= models.PositiveIntegerField(verbose_name='id equipo', default=0)
    Nombre=models.CharField(max_length=100, null=False, blank=False)
    Apellido=models.CharField(max_length=100, null=False, blank=False)
    FNacimiento=models.CharField(max_length=100, default=FALSE)
    Nacionalidad=models.CharField(max_length=100, null=False, blank=False)
    Rol = models.CharField(max_length=100, null=False, blank=False)

    def __str__(self):
        return self.Nombre

